document.getElementById('current-date').textContent = new Date().toLocaleDateString();

let productos = [];
let contadorItems = 1; // Contador para generar números de ítem automáticamente

function agregarProducto() {
  const tbody = document.querySelector('#productos-table tbody');
  const newRow = document.createElement('tr');

  newRow.innerHTML = `
    <td>${contadorItems}</td>
    <td><input type="text" class="descripcion" placeholder="Descripción"></td>
    <td><input type="text" class="und" placeholder="Und"></td>
    <td><input type="number" class="valor-unitario" placeholder="Valor Unitario"></td>
    <td><input type="number" class="cantidad" placeholder="Cantidad"></td>
    <td><input type="number" class="valor-total" readonly></td>
  `;

  tbody.appendChild(newRow);

  // Incrementar el contador de ítems
  contadorItems++;

  // Calcular valor total automáticamente
  newRow.querySelector('.cantidad').addEventListener('input', calcularValorTotal);
  newRow.querySelector('.valor-unitario').addEventListener('input', calcularValorTotal);

  function calcularValorTotal() {
    const cantidad = parseFloat(newRow.querySelector('.cantidad').value) || 0;
    const valorUnitario = parseFloat(newRow.querySelector('.valor-unitario').value) || 0;
    newRow.querySelector('.valor-total').value = (cantidad * valorUnitario).toFixed(2);
    calcularTotales();
  }
}

function calcularTotales() {
  let subtotal = 0;
  document.querySelectorAll('#productos-table tbody tr').forEach(row => {
    const valorTotal = parseFloat(row.querySelector('.valor-total').value) || 0;
    subtotal += valorTotal;
  });

  const gastosAdmin = (subtotal * 0.06).toFixed(2);
  const gastosImprevistos = (subtotal * 0.08).toFixed(2);
  const gastosUtilidad = (subtotal * 0.04).toFixed(2);
  const ivaUtilidad = (gastosUtilidad * 0.19).toFixed(2);
  const totalFinal = (subtotal + parseFloat(gastosAdmin) + parseFloat(gastosImprevistos) + parseFloat(gastosUtilidad) + parseFloat(ivaUtilidad)).toFixed(2);

  document.getElementById('subtotal').textContent = subtotal.toFixed(2);
  document.getElementById('gastos-admin').textContent = gastosAdmin;
  document.getElementById('gastos-imprevistos').textContent = gastosImprevistos;
  document.getElementById('gastos-utilidad').textContent = gastosUtilidad;
  document.getElementById('iva-utilidad').textContent = ivaUtilidad;
  document.getElementById('total-final').textContent = totalFinal;
}

document.getElementById('descargar-pdf').addEventListener('click', () => {
    const { jsPDF } = window.jspdf;
    const doc = new jsPDF();
  
    // Logo en Base64 (reemplaza esto con tu cadena Base64)
    const logoBase64 = "data:image/png;base64,";
  
   // Configurar fuente y tamaño inicial
   doc.setFont("helvetica", "normal");
   doc.setFontSize(9);
 
   // Información de la empresa en la esquina superior derecha (alineada a la derecha)
   const infoEmpresa = [
     "M-R DISEÑO Y REMODELACIONES",
     `NIT: 29741665 - 2`,
     `Fecha: ${document.getElementById('current-date').textContent}`,
   ];
   const maxWidth = 60; // Ancho máximo para el texto
   let yPos = 10; // Posición inicial vertical
 
   // Nombre de la empresa en negrita
   doc.setFont("helvetica", "bold");
   doc.text(infoEmpresa[0], doc.internal.pageSize.width - 10, yPos, { align: 'right' });
   yPos += 5;
 
   // Resto de la información en normal
   doc.setFont("helvetica", "normal");
   for (let i = 1; i < infoEmpresa.length; i++) {
     doc.text(infoEmpresa[i], doc.internal.pageSize.width - 10, yPos, { align: 'right' });
     yPos += 5; // Espaciado entre líneas
   }
 
   // Dividir el nombre del cliente en varias líneas
   const clienteValue = document.getElementById('cliente').value || "Sin cliente";
   const maxLines = 3; // Máximo de 3 líneas
   const lineHeight = 4; // Altura de cada línea
   const splitText = doc.splitTextToSize(clienteValue, maxWidth); // Dividir el texto según el ancho máximo
 
   // Limitar a 3 líneas
   const truncatedText = splitText.slice(0, maxLines); // Tomar solo las primeras 3 líneas
   if (splitText.length > maxLines) {
     truncatedText[maxLines - 1] += "..."; // Agregar puntos suspensivos si hay más de 3 líneas
   }
 
   // Escribir el nombre del cliente línea por línea
   truncatedText.forEach(line => {
     doc.text(line, doc.internal.pageSize.width - 10, yPos, { align: 'right' });
     yPos += lineHeight; // Incrementar la posición vertical para la siguiente línea
   });

  // Agregar logo al PDF (esquina superior izquierda)
  doc.addImage(logoBase64, 'PNG', 10, 10, 30, 30); // x, y, width, height

  // Nombre de la cotización (centrado, tamaño 11, negrita)
  const nombreCotizacion = document.getElementById('nombre-cotizacion').value || "Sin nombre";
  doc.setFontSize(11);
  doc.setFont("helvetica", "bold");
  doc.text(nombreCotizacion, doc.internal.pageSize.width / 2, 50, { align: 'center' }); // Centrado

  // Restaurar fuente normal para el resto del contenido
  doc.setFont("helvetica", "normal");

  // Función para formatear números con puntos cada 3 dígitos
  function formatNumber(num) {
    return num.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ".");
  }

  // Tabla de productos
  const columns = ["ITEM", "DESCRIPCION", "UND", "VLR UNITARIO", "CANTIDAD", "VLR TOTAL"];
  const rows = [];
  document.querySelectorAll('#productos-table tbody tr').forEach(row => {
    rows.push([
      row.querySelector('td:first-child').textContent,
      row.querySelector('.descripcion').value,
      row.querySelector('.und').value,
      formatNumber(parseInt(row.querySelector('.valor-unitario').value)), // Formatear valor unitario
      parseInt(row.querySelector('.cantidad').value),
      formatNumber(parseInt(row.querySelector('.valor-total').value)) // Formatear valor total
    ]);
  });

  // Crear tabla de productos (ajuste de ancho y tamaño de letra)
  doc.autoTable({
    head: [columns],
    body: rows,
    startY: 60, // Comienza después del título
    theme: 'grid', // Diseño tipo Excel
    styles: { 
      fontSize: 7, 
      cellPadding: 1, 
      halign: 'center', 
      font: 'helvetica',
      textColor: [0, 0, 0], // Texto negro
      lineWidth: 0.1,
      lineColor: [0, 0, 0] // Grosor de las líneas de la tabla
    },
    headStyles: { 
      fillColor: [255, 255, 255], // Fondo transparente (blanco)
      textColor: [0, 0, 0],       // Texto negro
      fontStyle: 'bold',          // Texto en negrita
      cellPadding: 1,             // Margen igual al de las celdas
      lineWidth: 0.1,             // Grosor de las líneas del encabezado
      lineColor: [0, 0, 0],       // Color de las líneas del encabezado
      valign: 'middle',           // Alineación vertical centrada
      halign: 'center',           // Alineación horizontal centrada
      fontSize: 7                 // Tamaño de fuente del encabezado
    },
    columnStyles: {
      0: { cellWidth: 12, halign: 'center' },  // Item (centrado)
      1: { cellWidth: 83, halign: 'left' },    // Descripción (izquierda)
      2: { cellWidth: 12, halign: 'center' },  // Und (centrado)
      3: { cellWidth: 30, halign: 'center' },  // Valor Unitario (centrado)
      4: { cellWidth: 22, halign: 'center' },  // Cantidad (centrado)
      5: { cellWidth: 30, halign: 'center' }   // Valor Total (centrado)
    }
  });

  // Resumen de costos
  const resumenCostos = [
    ["Subtotal", `$${formatNumber(parseInt(document.getElementById('subtotal').textContent))}`],
    ["Administración (6%)", `$${formatNumber(parseInt(document.getElementById('gastos-admin').textContent))}`],
    ["Imprevistos (8%)", `$${formatNumber(parseInt(document.getElementById('gastos-imprevistos').textContent))}`],
    ["Utilidad (4%)", `$${formatNumber(parseInt(document.getElementById('gastos-utilidad').textContent))}`],
    ["IVA sobre Utilidad (19%)", `$${formatNumber(parseInt(document.getElementById('iva-utilidad').textContent))}`],
    ["Total", `$${formatNumber(parseInt(document.getElementById('total-final').textContent))}`]
  ];

  // Crear tabla de resumen de costos (ajuste de ancho y tamaño de letra)
  doc.autoTable({
    head: [["Concepto", "Valor"]],
    body: resumenCostos,
    startY: doc.lastAutoTable.finalY + 5, // Comienza después de la tabla anterior
    theme: 'grid', // Diseño tipo Excel
    styles: { 
      fontSize: 7, 
      cellPadding: 1, 
      halign: 'center', 
      font: 'helvetica',
      textColor: [0, 0, 0],
      lineColor: [0, 0, 0] // Texto negro
    },
    headStyles: { 
      fillColor: [255, 255, 255], // Fondo transparente (blanco)
      textColor: [0, 0, 0],       // Texto negro
      fontStyle: 'bold',          // Texto en negrita
      cellPadding: 1,             // Margen igual al de las celdas
      lineWidth: 0.1,             // Grosor de las líneas del encabezado
      lineColor: [0, 0, 0],       // Color de las líneas del encabezado
      valign: 'middle',           // Alineación vertical centrada
      halign: 'center',           // Alineación horizontal centrada
      fontSize: 7                 // Tamaño de fuente del encabezado
    },
    columnStyles: {
      0: { cellWidth: 30, halign: 'left' },   // Concepto (izquierda)
      1: { cellWidth: 20, halign: 'center' }  // Valor (centrado)
    }
  });

    // Agregar nota opcional
    const nota = document.getElementById('nota').value.trim(); // Obtener el valor de la nota
    if (nota) {
        doc.setFontSize(8); // Tamaño de fuente para la nota
        doc.setFont("helvetica", "normal"); // Fuente normal para el contenido de la nota
        const maxWidthNota = 190; // Ancho máximo más largo para la nota
        const splitNota = doc.splitTextToSize(nota, maxWidthNota); // Dividir la nota en líneas más largas
        doc.text(splitNota, 10, doc.lastAutoTable.finalY + 20); // Contenido de la nota (posición ajustada)
    }

  // Descargar PDF
  doc.save('cotizacion.pdf');
});